**PR**: https://github.com/IMSGlobal/caliper-php/pull/37

**Issues**:

https://github.com/IMSGlobal/caliper-php/issues/33: According to Chris Vento, event payloads should look like:

````json
{
  "apiKey": "%{apiKey}",
  "sensorId": "%{sensorId}",
  "event": {
    //caliper event
  }
}
````

However, this code currently puts the event at the top level, without a "event" key and the "apiKey" and "sensorId" are missing, too.  Fix these.

https://github.com/IMSGlobal/caliper-php/issues/34: Implement support for Media events. The common fixtures only have JSON code for paused events, so that will be the target. Refer to caliper-java code for more information about other media event types as needed.

https://github.com/IMSGlobal/caliper-php/issues/35: Implement changes for extension, action, member, role, and organization that are present in caliper-java.

Due date: 2015-04-24 13:00

